/*
 * 页面拥有点击事件以后才可以触发警报
 * 调用方法：warnPlug.warn(参数1,参数2)
 * 参数1：警告的信息文字
 * 参数2：关闭弹窗时执行的回调函数
	warnPlug.warn("just test！", function() {
			console.log("88888")
	});
 */
var warnPlug = {
	existJQuery: true, //默认页面存在Jquery
	msglist: [],//消息列表
	Count: 0, //默认报警了0次
	callbackFun: '',
	cssstyle: function(time) {
		time = time || '0.5s';
		return '.warnwapper {' +
			'  position: fixed;' +
			'  top: 0;' +
			'  right: 0;' +
			'  left: 0;' +
			'  bottom: 0;' +
			'  z-index: 666;' +
			'  background: rgba(0, 93, 147, 0.7);' +
			'  animation: myfirstWarn ' + time + ' ease 0s infinite alternate;' +
			'}' +
			'.warnMSg {' +
			'  position: fixed;' +
			'  top: 50%;' +
			'  left: 50%;' +
			'  width: 560px;' +
			'  height: auto;' +
			'  transform: translate(-50%, -50%);' +
			'  background: -webkit-linear-gradient(#217eff, #1c99cf);' +
			'  background: -o-linear-gradient(#217eff, #1c99cf);' +
			'  background: -moz-linear-gradient(#217eff, #1c99cf);' +
			'  background: linear-gradient(#217eff, #1c99cf);' +
			'  color: #fff;' +
			'  z-index: 668;' +
			'  border-radius: 10px;' +
			'  box-sizing: border-box;' +
			'  padding:25px 20px 15px;' +
			'}' +
			'.warnMSg .pre{' +
			'  width: 100%;' +
			'  height: auto;' +
			'  max-height: 432px;' +
			'  overflow: auto;' +
			'  box-sizing: border-box;' +
			'  margin:0 0 20px 0;'+
			'}' +
			'.warnMSg .pre p{' +
			'	margin:0;'+
			'	padding:0;'+
			'  font-size: 18px;' +			
			'  text-align: left;' +			
			'	line-height:36px;'+
			'   word-wrap:break-word;'+
			'   word-break: break-all;'+
			'}' +			
			'.warnMSg button {' +
			'  background: none;' +
			'  width: 130px;' +
			'  height: 36px;' +
			'  border: none;' +
			'  outline: none;' +
			'  cursor: pointer;' +
			'  float: right;' +
			'  margin: 0px -5px 0 0;' +
			'  font-size: 17px;' +
			'  color: #fff;' +
			'  border-radius: 5px;' +
			'  transition: all .1s;' +
			'}' +
			'.warnMSg button:hover {' +
			' /* background: #217eff;*/' +
			'}' +
			'@keyframes myfirstWarn {' +
			'  0% {' +
			'    box-shadow: 0 0 30px 10px #217eff inset;' +
			'    opacity: 0;' +
			'  }' +
			'  50% {' +
			'    box-shadow: 0 0 150px 50px #217eff inset;' +
			'    opacity: 0;' +
			'  }' +
			'  100% {' +
			'    box-shadow: 0 0 400px 130px #217eff inset;' +
			'    opacity: 1;' +
			'  }' +
			'}';

	},
	musicUrl: function() {
		return "data:audio/mp3;base64," + "";
	},
	addCssByStyle: function(cssString) {
		var doc = document;
		var style = doc.createElement("style");
		style.setAttribute("type", "text/css");
		if(style.styleSheet) { // IE 
			style.styleSheet.cssText = cssString;
		} else { // w3c 
			var cssText = doc.createTextNode(cssString);
			style.appendChild(cssText);
		}
		var heads = doc.getElementsByTagName("head");
		if(heads.length) {
			heads[0].appendChild(style);
		} else {
			doc.documentElement.appendChild(style);
		}
	},
	htmlText: function(msg) {
		warnPlug.msglist.push(msg);
		var str="";
		warnPlug.msglist.forEach(function(item,idx,arr){
			str=str+"<p>"+item+"</p>";
		});
		if(warnPlug.Count == 0) {
			var htmls = '<div class="warnwapper"></div>' +
				'<div class="warnMSg">' +
				'	<div class="pre">' + str + '</div>' +
				'	<button onclick="warnPlug.warnStop()">马上处理...</button>' +
				'</div>';
			$("body").append(htmls);			
		}else{
			$('.warnMSg>.pre').html(str);
		}
	},
	addJQuery: function() {
		var heads = document.getElementsByTagName("head"),
			script = document.createElement('script');
		if(typeof jQuery == 'undefined') {
			warnPlug.existJQuery = false;
			script.type = "text/javascript";
			script.src = "https://apps.bdimg.com/libs/jquery/2.1.4/jquery.min.js";
		}
		if(heads.length) {
			heads[0].insertBefore(script, heads[0].childNodes[0]);
		} else {
			document.documentElement.appendChild(script);
		}
	},
	playSound: function(audioUrl) {
		var borswer = window.navigator.userAgent.toLowerCase();
		if(warnPlug.Count == 0) {
			if(borswer.indexOf("ie") >= 0) { //IE内核浏览器
				var strEmbed = '<embed name="embedPlay" src="' + audioUrl + '" autostart="false" hidden="true" loop="true"></embed>';
				if($("body").find("embed").length <= 0)
					$("body").append(strEmbed);
				document.embedPlay.volume = 100;
				document.embedPlay.play();
			} else { //非IE内核浏览器
				var strAudio = "<audio id='audioPlay' src='" + audioUrl + "' hidden='true' muted>";
				if($("body").find("audio").length <= 0)
					$("body").append(strAudio);
				var audio = document.getElementById("audioPlay");
				audio.setAttribute('loop', 'infinite');
				if(audio.muted) {
					audio.muted = false;
				}
				audio.volume = 1;
				audio.load();
				let playPromise = audio.play();
				if(playPromise !== undefined) {
					playPromise.then(() => {
						audio.play();
					}).catch((e) => {
						setTimeout(function() {
							document.getElementsByTagName("body")[0].click();						
							warnPlug.playSound(warnPlug.musicUrl());
						}, 1000);						
					})
				}
			}
		} else {
			if(borswer.indexOf("ie") >= 0) { //IE内核浏览器
				document.embedPlay.play();
			} else { //非IE内核浏览器
				var audio1 = document.getElementById("audioPlay");
				audio1.setAttribute('loop', 'infinite');
				if(audio1.muted) {
					audio1.muted = false;
				}
				audio1.volume = 1;
				audio1.load();				
				let playPromise = audio1.play();
				if(playPromise !== undefined) {
					playPromise.then(() => {
						audio1.play();
					}).catch((e) => {
						setTimeout(function() {
							document.getElementsByTagName("body")[0].click();							
							warnPlug.playSound(warnPlug.musicUrl());
						}, 1000);						
					})
				}
			}
		}
	},
	warn: function(msg, callback) {
		if(warnPlug.Count == 0) {
			warnPlug.addJQuery();
			setTimeout(function() {
				warnPlug.addCssByStyle(warnPlug.cssstyle('0.3s'));
				warnPlug.htmlText(msg);
				warnPlug.playSound(warnPlug.musicUrl());
				warnPlug.Count = Number(warnPlug.Count) + 1;
			}, 1200)
		} else {
			warnPlug.htmlText(msg);
			$('.warnwapper,.warnMSg').show();
			warnPlug.playSound(warnPlug.musicUrl());
			warnPlug.Count = Number(warnPlug.Count) + 1;
		}
		if(callback && (typeof callback == 'function')) {
			warnPlug.callbackFun = callback;
		}
	},
	warnStop: function(callback) {
		var borswer = window.navigator.userAgent.toLowerCase();
		if(borswer.indexOf("ie") >= 0) { //IE内核浏览器
			document.embedPlay.stop();
		} else { //非IE内核浏览器
			document.getElementById("audioPlay").pause();
			document.getElementById("audioPlay").currentTime = 0;
		}
		$('.warnwapper,.warnMSg').hide();
		$('.warnMSg>.pre').html('');
		warnPlug.msglist=[];
		if(warnPlug.callbackFun != '') {
			warnPlug.callbackFun();
		}
	}
}